import React from "react";
import { Card, Row, Col, ProgressBar } from "react-bootstrap";
// Containers 

const Containers = () => {
  return (
    <>   
      <Card className="text-white border-0 shadow-sm p-4 mt-5" style={{ backgroundColor: "#2c2f48" }}>
         
         
        <div className="d-flex justify-content-between align-items-center mb-4">
          <h4 className="fw-bold">Containers Overview</h4>
          <Badge bg="secondary" pill>
            3 Containers
          </Badge>
        </div>
        <Row className="g-4">
          
            <Col>
              <Card className=" border-0 text-white p-4 rounded-4 h-100 shadow-sm" style={{ backgroundColor: "#3a3f5c" }}>
                <h5 className="fw-semibold mb-3 text-center">Container A</h5>
                
                  
            </Card>
            </Col>
        </Row>
      </Card>
    </>
  );
};


export default Containers;
